description:
Xilisoft Video Converter for Mac is a feature-rich video converter that supports virtually all audio and video formats like AVI, MPEG, WMV, DivX, MP4, H.264/AVC, MOV, MP2, MP3, WMA, OGG, AAC, M4A, WAV and AC3. Options such as batch-capturing still shots from movies and creating videos from pictures are possible.

Version: 5.0
Perfect support of High-Definition video and lossless audio formats;
Clip video to get beloved segments and remove unwanted parts;
Merge many video files into a whole to convert;
Add watermark, apply art effect, crop video size to edit the video;
Preview source and fixed videos at the same time for comparison;
Simultaneously set various formats on the same file to output;
Batch capture pictures from video, create vivid video from photo collection;
Convert video in the file size you specify with Bitrate Calculator.


